import styled, { css } from 'styled-components';

const Nav = styled.nav`
  background-color: blue;

  ${props =>
    props.isRed &&
    css`
  background-color: red;`}
`;

const Container = styled.div`
  border: 1px solid;
  margin: 0rem;
`;

const InnerRoot = styled.div`
height: 100vh;
display: grid;
placeContent: center;
`;

export { Nav, Container, InnerRoot }
